import React from 'react';
import './ar.css';

function headerBar() {
    return (
        <div className="App">
            <header className="App-header">
                <div className="App-logo" />
                <span className="App-Title">Chatter</span>
            </header>
        </div>
    );
}
  export default headerBar;
